import React from 'react'; 
import Hero from "../components/Hero";
import Content from "../components/Content";
function AboutPage(props)
{
    return (
        <div>
         <Hero title ={props.title}> </Hero>

         <Content>
            <p>I am a student at Ryerson University currently majoring in Computer Engineering. The program is a perfect fit for me as I enjoy learning about analysis and design of complex systems. I also like learning new things through projects and work. In the future, I want to further my skills in software development by taking on harder challanges and pushing myself to the limit. This year, I plan to sharpen my skills and work more on personal projects to prepare myself for future internships.</p>
        </Content>
        </div>
        
    ); 
 
    
} 
export default AboutPage;
